import React from "react";

export default function SubTitle({ bgColor, rotate }) {
  return (
    <div className="bg-[#212121] text-white">
      <div className="flex items-center subtitle py- justify-between font-PoppinsRegular">
        <span className="mt-2.5">UI/UX</span>
        <span className="inline-block w-2 h-2 rounded-full bg-maincolor mx-12"></span>
        <span className="mt-2.5">Front End</span>
        <span className="inline-block w-2 h-2 rounded-full bg-maincolor mx-12"></span>
        <span className="mt-2.5">afblog</span>
        <span className="inline-block w-2 h-2 rounded-full bg-maincolor mx-12"></span>
        <span className="mt-2.5">Coffe</span>
        <span className="inline-block w-2 h-2 rounded-full bg-maincolor mx-12"></span>
        <span className="mt-2.5">Code</span>
        <span className="inline-block w-2 h-2 rounded-full bg-maincolor mx-12"></span>
        <span className="mt-2.5">Game</span>
      </div>
    </div>
  );
}
